Rusland
Animatie / Fantasy
80 minuten

leuk

met de stemmen van Ivan Okhlobystin, Nyusha en Anna Ardova

Kai wordt ontvoerd door de sneeuwkoningin. Ondanks de strenge winter zet zijn zusje Gerda koers naar het paleis van de koningin. 
Ze krijgt hulp van vele nieuwe vrienden die ze onderweg maakt. Samen zullen zij proberen Kai te bevrijden.
